import React from "react";

import axios from "axios";

const App = () => {
  const generate = () => {
    console.log("hi");
    axios
      .post("http://localhost:3001/api/insert", { name: "hi", rating: 5 })
      .then(() => {
        alert("hi");
      })
      .catch((err) => console.log(err));
  };
  return (
    <div>
      <h1>PathBuilder</h1>
      <button onClick={generate}>Generate route!</button>
    </div>
  );
};

export default App;
